/*global kakao*/
import React, { useEffect, useRef, useState } from "react";
import icon from "../../lib/icon/loc.png";
import iconDark from "../../lib/icon/dot.png";
import SwipeableEdgeDrawer from "./SwipeableEdgeDrawer";
import FetchShowTags from "./FetchShowTags";
import { Map, MapMarker } from "react-kakao-maps-sdk";

function KakaoMap({ lat, lng, flag, galleriesMarker }) {
  console.log(galleriesMarker[0].latlng);
  return (
    <div>
      <Map
        center={{ lat: lat, lng: lng }}
        style={{ width: "100%", height: "480px" }}
      >
        <MapMarker position={{ lat: lat, lng: lng }}></MapMarker>
        {galleriesMarker.map((e) => {
          return <MapMarker position={e.latlng}></MapMarker>;
        })}
      </Map>
    </div>
  );
}

export default KakaoMap;
